import React from 'react';
import { NavLink } from 'react-router-dom';

import HeaderItem from '../HeaderItem/HeaderItem';

import styles from './Header.module.css';


export default () => {
	return (
		<div className={styles.board}>
				<NavLink to={'authorization'} className={styles.link} activeClassName={styles.activeItem}> 
					<HeaderItem text={"Авторизация"} />
				</NavLink>
				<NavLink to={localStorage.getItem('schedule') ? 'appointment/department' : '#'} className={styles.link} activeClassName={styles.activeItem}> 
					<HeaderItem text={"Записатьcя"} />
				</NavLink>
				<NavLink to={localStorage.getItem('schedule') ? 'appointments' : '#'} className={styles.link} activeClassName={styles.activeItem}> 
					<HeaderItem text={"Мои записи"} />
				</NavLink>
				<NavLink to={'help'} className={styles.link} activeClassName={styles.activeItem}> 
					<HeaderItem text={"Помощь"} />
				</NavLink>
		</div>
	);
};
